import React from 'react';
import "./Form.css";

<span>
    Alexander Neumann is a 27 year old graphic designer and developer of this Front-End Challenge.
    In his graphic design work, he has worked for <a href="https://en.wikipedia.org/wiki/Christopher_Wylie"
        target="_blank">Christopher Wylie</a> on a freelance basis, and developed his own block stacking game, <a
            href="https://vimeo.com/648414048" target="_blank">Misfits</a>
</span>

export default AlexanderNeumann;
